#include<stdio.h>
#include<gsl/gsl_interp.h>
#include"pl.h"

double *lage;
double *zz;
double *m;
int nm = 14;
int nz = 6;
int na = 220;

void GetMags(double lpa, double pz, double mags[])
{
	int i;
	int ia;
	int iz;
	int flag=0;
	double aa,ab;
	double za,zb;
	double fa,fz;

	iz = gsl_interp_bsearch(zz,pz,0,nz);
	ia = gsl_interp_bsearch(lage,lpa,0,na);
	
	if((lpa < lage[0])||(lpa >=lage[na-1]))
		flag = 3;
	if(pz < zz[0])
	{
		if((lpa < lage[0])||(lpa >=lage[na-1]))
		{
			flag=1;
		}else{
			flag=2;
		}
	}
	if(pz >=zz[nz-1])
	{
		if((lpa < lage[0])||(lpa >=lage[na-1]))
		{
			flag=1;
		}else{
			flag=2;
		}
	}


	switch(flag)
	{
		case 1:  for(i=0;i<nm;i++)
				mags[i] = m[na*nz*i + na*iz + ia];
			 break;
		case 2:  aa = lage[ia];
			 ab = lage[ia+1];
			 fa = (lpa - aa)/(ab-aa);
			 for(i=0;i<nm;i++)
				mags[i] = m[i*na*nz + na*iz + ia]+fa*(m[i*na*nz + na*iz + ia+1]-m[i*na*nz + na*iz + ia]);
			 break;
		case 3:  za = zz[iz];
			 zb = zz[iz+1];
			 fz = (pz - za)/(zb-za);
			 for(i=0;i<nm;i++)
				mags[i] = m[i*na*nz + na*iz + ia]+fz*(m[i*na*nz + na*(iz+1) + ia]-m[i*na*nz + na*iz + ia]);
			 break;
		default: aa = lage[ia];
			 ab = lage[ia+1];
			 fa = (lpa - aa)/(ab-aa);
			 za = zz[iz];
		 	 zb = zz[iz+1];
			 fz = (pz  - za)/(zb-za);
			 for(i=0;i<nm;i++)
			 	mags[i] = (1.0-fa)*(1.0-fz)*m[i*na*nz + na*iz + ia] + fa*(1.0-fz)*m[i*na*nz + na*iz + ia +1] + fa*fz*m[i*na*nz + na*(iz+1) + ia +1] + (1.0-fa)*fz*m[i*na*nz + na*(iz+1) + ia];
	 		 break;
	}
	/*for(i=0;i<nm;i++)
		if(mags[i]==0.0)
		{
			printf("mags[%d] ==0.0!\n",mags[i]);
			exit(-1);
		}*/
}

void AllocateMagnitudes(void)
{
	zz   = (double *) malloc(nz*sizeof(double));
	lage = (double *) malloc(na*sizeof(double));
	m   = (double *) malloc(nm*na*nz*sizeof(double));
}
void FreeMagnitudes(void)
{
	free(zz);
	free(lage);
	free(m);
}
